export class AppFactory {
  constructor(baseUrl) {
    this._baseUrl = baseUrl;
    this._links = {
      root: '/'
    };
  }

  get baseUrl () {
    return this._baseUrl;
  }

  get links () {
    return this._links
  }

  setLink(name, link) {
    this._links[name] = link;
  }
}
